import "./App.css";
import uploadedVideoData from "./data/uploadedVideoData.json";


const dataVideo = uploadedVideoData;
//console.log(dataVideo)
function VideoDisplay(){
    const [score, setScore] = useState(0);
    function increment() {
        setScore(s => s + 1);
      }
    function decrement() {
        setScore(s => s - 1)
    }



    return (
    <div class="videoDisplayContainer">
      {dataVideo.map(element=> {return (<div><div class="displayGrid"><h5>{element.title}</h5>
      <div>
      <iframe width="330" height="200"
src={element.url} title={element.title}border="none" border-radius="103px"frameborder='0'allowfullscreen align="center">
</iframe></div><div> 
   {score}</div><div class="likedislikeBtn">
   <a href="#0" class="btn btn-info btn-lg"  onClick = {() => increment()} >
          <span class="glyphicon glyphicon-thumbs-up"></span> Like
        </a>

        <a href="#0" class="btn btn-info btn-lg">
          <span class="glyphicon glyphicon-thumbs-down"  onClick = {() => decrement()}></span>Unlike
        </a>
      </div> <div class="aligndeletebutton"><button class="deleteBtn">Delete</button></div></div></div>)})}
    </div>)
}
export default function AllVideoDisplay(){

    return(
        <VideoDisplay />
